  const [search, setSearch] = useState("")
  return (
    <div>
      <Search />
      <AddTransactionForm transactions={transactions} setTransactions={setTransactions} />
      <TransactionsList transactions={transactions} setTransactions={setTransactions} />
    </div>
  );
}

